import { useState } from "react";


function App() {
  const [modal, setModal] = useState(false);

  const Toggle = () => setModal(!modal);

  return (
    <div className="App">
      <button className="clickMe" onClick={() => Toggle()}>
        Modal
      </button>

      <Modal show={modal} close={Toggle} title="Dynamic Title">
        This is modal content
      </Modal>
    </div>
  );
}

export default App;
